contract ZEENETH_TOKEN is Context, IERC20, IERC20Errors, ReentrancyGuard {

    event Log(string message, uint val, uint decimals);
    event LogAddress(string message, address val);
    event LiquidityAdded(uint _id);

    address admin;
    mapping(address account => uint256) private _balances;
    mapping(address account => mapping(address spender => uint256)) private _allowances;
    mapping(address => uint) public referralAccount;
    uint public fundingExpiration;
    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    uint buyPrice = 50000;
    uint minBuyAmount = 1e16;
    uint public minReferral;
    IUniswapV2Factory _factory = IUniswapV2Factory(0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f);
    IUniswapV2Router02 _router = IUniswapV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
    address WETH_ADDRESS;
    address public _poolAddress;

    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
        admin = msg.sender;
        
         if(getChainID() == 1){
            WETH_ADDRESS = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;
            fundingExpiration = block.timestamp + 7*86400;  // Initial Funding Ends in 7 Days
        }

        if(getChainID() == 5){
             WETH_ADDRESS = 0xB4FBF271143F4FBf7B91A5ded31805e42b2208d6; //GOERLI
             fundingExpiration = block.timestamp + 7200;  // TESTING
        }

        _poolAddress = _factory.createPair(address(this), WETH_ADDRESS);
        minReferral = 10;  //10 tokens need to be held by referrer in order to receive 5% refferral fee.
        

    }

    function getChainID() internal view returns (uint256) {
        uint256 id;
        assembly {
            id := chainid()
        }
        return id;
    }

    function getTimeRemaining() external view returns(uint) {
        //require(fundingExpiration > block.timestamp,'FUNDING PERIOD EXPIRED');
        if(fundingExpiration > block.timestamp){
            return (fundingExpiration - block.timestamp);
        } else {
            return(0);
        }
        
    }

    function getTime() external view returns(uint){
        return(block.timestamp);
    }

    function buyToken(address _referral) payable external nonReentrant returns(uint){
        require(block.timestamp < fundingExpiration, 'FUNDING PERIOD EXPIRED');
        require(msg.value >= minBuyAmount, 'Below the Minimum Buy Amount');
        uint _toAdminAmount = msg.value*5/100;
        uint _amount = (msg.value*90/100)*buyPrice;
        if(_referral != address(0) && _referral != msg.sender && IERC20(address(this)).balanceOf(_referral) >= minReferral){
            payable(_referral).transfer(msg.value*5/100);
        } else {
            _toAdminAmount += msg.value*5/100;
        }
        payable(admin).transfer(_toAdminAmount);

        _mint(address(this),_amount);
        _transfer(address(this),msg.sender,_amount*10/100);
   
        IERC20(address(this)).approve(address(_router), _amount*90/100);
    
        (uint _amount0, uint _amount1, uint _liquidity) = _router.addLiquidityETH{value: msg.value*90/100}(
            address(this),
            _amount*90/100,
            0,
            0,
            msg.sender,
            block.timestamp + 1
        );

        return(_liquidity);

    }

    function name() public view virtual returns (string memory) {
        return _name;
    }

    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual returns (uint8) {
        return 18;
    }

    function totalSupply() public view virtual returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual returns (uint256) {
        return _balances[account];
    }

    function transfer(address to, uint256 value) public virtual returns (bool) {
        address owner = _msgSender();
        _transfer(owner, to, value);
        return true;
    }

    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 value) public virtual returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) public virtual returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, value);
        _transfer(from, to, value);
        return true;
    }

  
    function _transfer(address from, address to, uint256 value) internal {
        
        //  Only allow transfers and selling after the initial funding period os complete
        if((to == _poolAddress && from != address(_router) && from != address(this)) || from == _poolAddress){
            require(fundingExpiration < block.timestamp,'FUNDING PERIOD ONGOING[TRANSFER]');
        }


        if (from == address(0)) {
            revert ERC20InvalidSender(address(0));
        }
        if (to == address(0)) {
            revert ERC20InvalidReceiver(address(0));
        }
        _update(from, to, value);
    }

    function _update(address from, address to, uint256 value) internal virtual {
        if (from == address(0)) {
            // Overflow check required: The rest of the code assumes that totalSupply never overflows
            _totalSupply += value;
        } else {
            uint256 fromBalance = _balances[from];
            if (fromBalance < value) {
                revert ERC20InsufficientBalance(from, fromBalance, value);
            }
            unchecked {
                // Overflow not possible: value <= fromBalance <= totalSupply.
                _balances[from] = fromBalance - value;
            }
        }

        if (to == address(0)) {
            unchecked {
                // Overflow not possible: value <= totalSupply or value <= fromBalance <= totalSupply.
                _totalSupply -= value;
            }
        } else {
            unchecked {
                // Overflow not possible: balance + value is at most totalSupply, which we know fits into a uint256.
                _balances[to] += value;
            }
        }

        emit Transfer(from, to, value);
    }

 
    function _mint(address account, uint256 value) internal {
        if (account == address(0)) {
            revert ERC20InvalidReceiver(address(0));
        }
        _update(address(0), account, value);
    }

 
    function _burn(address account, uint256 value) internal {
        require(fundingExpiration < block.timestamp,'FUNDING PERIOD ONGOING');
        if (account == address(0)) {
            revert ERC20InvalidSender(address(0));
        }
        _update(account, address(0), value);
    }


    function _approve(address owner, address spender, uint256 value) internal {
        _approve(owner, spender, value, true);
    }


    function _approve(address owner, address spender, uint256 value, bool emitEvent) internal virtual {
        if (owner == address(0)) {
            revert ERC20InvalidApprover(address(0));
        }
        if (spender == address(0)) {
            revert ERC20InvalidSpender(address(0));
        }
        _allowances[owner][spender] = value;
        if (emitEvent) {
            emit Approval(owner, spender, value);
        }
    }

  
    function _spendAllowance(address owner, address spender, uint256 value) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            if (currentAllowance < value) {
                revert ERC20InsufficientAllowance(spender, currentAllowance, value);
            }
            unchecked {
                _approve(owner, spender, currentAllowance - value, false);
            }
        }
    }
}
